import { Menu, Icon } from 'antd';

import React, { Component } from 'react';

class Profile extends Component {
  render() {
    return (
        <Menu mode="horizontal">
          <Menu.Item key="item">
            <Icon type="mail" />Navigation One
          </Menu.Item>
        </Menu>
    );
  }
}

export default Profile;
